1.后面绑定的市场、套餐或零售商覆盖之前绑定的，修改后当天价格改变，历史价格不变
2.先设置入参direction=BOTHWAY，后设置direction=IMPOR或EXPORT，之前设置的全部被清除，只保留本次方向
3.先设置入参direction=IMPOR或EXPORT，后设置direction=IMPOR或EXPORT，同方向被覆盖，不同方向无变化
4.先设置入参direction=IMPOR、EXPORT或BOTHWAY，后设置direction=BOTHWAY，全部方向被覆盖
5.方向说明：
市场、套餐或零售商方向direction=BOTHWAY，此api绑定支持BOTHWAY EXPORT IMPOR
市场、套餐或零售商方向direction=IMPOR，此api绑定支持IMPOR
市场、套餐或零售商方向direction=EXPORT，此api绑定支持EXPORT
例子：
// 绑定市场 支持BOTHWAY EXPORT IMPOR
{
    "stationId": "1818106959310934017",
    "priceId": "1818107260584292353",
    "direction": "BOTHWAY",
}
// 绑定套餐 支持BOTHWAY EXPORT IMPOR
{
    "stationId": "1818106959310934017",
    "priceId": "1818107260584292353",
    "direction": "BOTHWAY",
}
// 绑定Amber零售商 必须BOTHWAY
{
    "stationId": "1818106959310934017",
    "priceId": "1818107260584292353",
    "direction": "BOTHWAY",
    "expandParam": {
        "token": "psk_18767dbc7efad76a24d190f291d72c40"
    }
}
// 绑定Tibber零售商 仅支持IMPORT
{
    "stationId": "1818106959310934017",
    "priceId": "1818107260584292353",
    "direction": "IMPORT",
    "expandParam": {
        "token": "psk_18767dbc7efad76a24d190f291d72c40"
    }
}
// 绑定LocalVolts零售商 必须BOTHWAY
{
    "stationId": "1818106959310934017",
    "priceId": "1818107260584292353",
    "direction": "BOTHWAY",
    "expandParam": {
        "partner": "xxxxxxxxxxxxxx",
        "apiKey": "xxxxxxxxxxxxxx",
    }
}
